import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

import Bg_image from 'client/src/assets/images/background1.jpg'

const Jumbo = styled.div `
    width:100%;
    height: 80vh;
    background-image: url(${Bg_image});
`;
const Section = styled.div `
   border-radius:50px;
`;

function Landing() {
    return (
    <React.Fragment>
        <Navigation />

        <Jumbo>
            <Container fluid='lg' className="flex">

            </Container>
        </Jumbo>

        <Section>
            <Container>
                <h1> Section Content</h1>
            </Container>
        </Section>

    </React.Fragment>


    )
}

export default Landing
